4.2 闪屏动画
应用方入口Activity需继承com.lib.xh.sdk.XHSplashActivity。
注意：游戏中相关操作，如：游戏初始化等，请勿在本activity进行操作。因为有些渠道是没有闪屏页的
闪屏Activity和游戏Activity在清单中必须添加如下配置，否则无法通过审核
