XHConfig config = new XHConfig();
config.setLandscape(true);//设置方向 横屏 true 竖屏false
config.setDebug(true);//设置debug模式,对应测试环境，正式打包时，请修改为false
XHSDK.getInstance().initApplication(this,config);

4.3.2 Game初始化
请在游戏Activity,如:GameActivity中调用一下游戏初始化方法，并保证游戏运行期间 该Activity不被销毁，否则会引起crash。
渠道操作拉起游戏的情景下，有可能会出现游戏Activity被拉起两个的情况,
所以在游戏Activity的onCreate里面需要检测当前Activity是否是重复的游戏Activity，如重复请去除。
注意：该方法必须要先于sdk.onCreate()方法执行
