4.5.2 支付调用
void doPayBySDK(Context context, XHCpPayInfo cpPayInfo);

通过实现XHCallBack接口获取支付结果通知，onSuccess的回调仅表示用户是否完成支付操作，由于支付到账延迟的情况偶有发生，支付是否成功将通过后台通知开发商的支付回调地址。只有开发商的服务器接到成功的通知，支付才算成功。
4.6 退出接口
void quit(Context context)

在调用此接口前需要判断渠道是否存在退出接口，可通过boolean hadPlatformQuitUI()方法判断，true表示存在渠道退出，false表示不存在渠道退出
如果存在再调用该接口，否则游戏自行实现退出游戏操作，调用该接口，点击确定时将回调quit（）方法，取消时回调cancel（）方法；
4.7 销毁接口
void destroySDK(Context context)

此接口将回收SDK的资源，在游戏退出时需要调用销毁接口，以便释放内存。
